html {
    height: 100%;
    width: 100%;
}
body {
    background: url('data:image/png;base64,') repeat;
    display: -ms-flexbox;
    display: -webkit-flex;
    display: flex;
    flex-direction: column;
    min-height: 100%;
    width: 100%;
    font: normal 16px sans-serif;
    line-height: 1.5em;
    color: #555;
}
h1 {
    font-size: 1.5em;
    margin-bottom: 20px;
    color: #666;
    text-align: center;
}
h2 {
    font-size: 1.3em;
    margin-bottom: 15px;
    color: #555;
    text-align: center;
    margin-top: 35px;
    vertical-align: middle;
}
h2 .fa-check {
    font-size: 0.7em;
    vertical-align: 15%;
}
h3 {
    font-size: 1.4em;
    margin-bottom: 15px;
    color: #555;
    text-align: center;
    margin-top: 35px;
}
a {
    text-decoration: underline;
    color: #6A9452;
}
a.bold {
    font-weight: bold;
}
a:hover, a.bold:hover {
    text-decoration: underline;
    color: #6A9452;
}
b {
    color: #555;
}
ul {
    width: 100%;
    text-align: left;
}
html[dir=rtl] ul {
    text-align: right;
}
form {
    text-align: left;
}
*::selection {
    background: #94B87F;
    color: white;
}

/* layout */

#header {
    padding-top: 20px;
    text-align: center;
}
#topLinks > span {
    margin-left: 5px;
    margin-right: 5px;
}
#content {
    flex: 1;
    width: 100%;
    height: 100%;
    display: -ms-flexbox;
    display: -webkit-flex;
    display: flex;
    -ms-flex-align: center;
    align-items: center;
    padding-bottom: 60px;
}
#contentBody, .alert {
    text-align: center;
    font-size: 15px;
}
#logoContainer {
    padding: 30px 0 25px 0;
    text-align: center;
}
#logo {
    max-width: 340px;
    height: 67px;
    margin: 0 auto;
}
#logo img {
    width:100%;
}
#footer {
    text-align: center;
    padding-bottom: 30px;
}
.footerLink {
    white-space: nowrap;
    font-weight: bold;
}
.footerLinksPrimary {
    color: #666666;
    margin-bottom: 20px;
}
.footerLinksPrimary span {
    white-space: nowrap;
    margin-right: 5px;
    margin-left: 5px;
}

/* content */

form.inlineForm {
    text-align: center;
}
div.message
{
    line-height: 20px;
    background-color: #EADFCA;
    border-radius: 5px;
    padding: 6px;
    overflow: hidden;
    margin-top: 10px;
    border: 1px solid #D7C29A;
}
div#indexContent {
    padding-top: 15px;
}
div#proxyForm {
    background-color: #E9F0E5;
    border-radius: 5px;
    padding: 10px 0;
    margin: 20px 0 20px 0;
}
div#proxyForm form {
    margin: 0 10px;
}
div#proxyForm form > #requestSubmit {
    width: 100%;
}
.proxyFormPremium {
    width: 535px;
    float: left;
}
.proxyFormPremiumButton {
    float: right;
    margin-right: 10px;
}
.proxyFormPremiumButton a {
    width: 185px;
}
div#quickLinks {
    display: table;
    margin: 10px 10px 0 10px;
    font-size: 1.25em;
}
a.proxyLink {
    cursor: pointer;
    white-space: nowrap;
}
div#browserExtension {
    display: none;
    margin: 0 auto 15px auto;
}
.textLarge {
    font-size: 1.1em;
}
.articleImage {
    margin: 40px 0;
}
.numberCircle {
    border-radius: 50%;
    padding: 3px 10px;
    background: #8E8D8D;
    display: inline-block;
    color: white;
}
.strong {
    font-size: 1.3em;
    font-weight: bold;
    line-height: 1.25em;
    padding-bottom: 10px;
    margin-bottom: 10px;
    color: #555;
}
.highlighted {
    padding: 2px 0;
    display: inline-block;
    color: #555555;
    font-weight: bold;
}
.highlighted a {
    font-weight: bold;
}
.highlighted .fa-star {
    color: #F6CD53;
    text-stroke: 2px #7DA963;
    -webkit-text-stroke: 2px #7DA963;
}
p.conclusion {
    font-weight: bold;
    color: #444;
}
.green {
    color: green;
}
.gray {
    color: gray;
}
.red {
    color: red;
}
#accountModal {
    text-align: left;
}
.accountModalMessage
{
    padding: 10px;
}
#subscriptionForm {
    width: 100%;
    min-height: 500px;
    border: 0;
}
.settings-panel {
    margin-bottom: 12px;
}
.settings-checkbox {
    margin-bottom: 0;
}
#messageModalContent {
    padding: 20px;
    font-size: 1.3em;
    text-align: center;
}
div#guides {
    width: auto;
    display: table;
    margin: 0 auto;
}
div#guides ul li {
    margin-top: 10px;
}

/* zappers */

div#zapperTop {
    padding-bottom: 10px;
}
div#zapperBottom {
    padding-top: 12px;
    width: 100%;
}
div#zapperSquare {
    min-height: 252px;
    margin: 25px 0 20px 0;
    display: flex;
    align-items: center;
    justify-content: center;
}
div#zapperIndexLeft {
    width: 336px;
    display: inline-block;
    align-self: flex-start;
}
div#zapperIndexRight {
    width: 336px;
    margin-left: 25px;
    display: inline-block;
    align-self: flex-start;
}
div#zapperSquareLeft {
    width: 336px;
    margin-right: 25px;
    display: inline-block;
    align-self: flex-start;
}
div#zapperSquareRight {
    width: 336px;
    display: inline-block;
    align-self: flex-start;
}
div#zapperHorizontal {
    margin: 25px 0 20px 0;
    width: 100%;
}
/*
#croxyFormZapperDesktop {
    display: block;
    width: 728px;
    margin: 0 auto;
}
#croxyFormZapperMobile {
    display: none;
    width: 300px;
    margin: 0 auto;
}
*/
#croxyExtraZapper {
    margin: 30px 0 20px 0;
    width: 100%;
    min-height: 195px;
}
.zapperTest {
    border: 1px dotted red;
}

/* social buttons */

.socialButtonsWidget {
    display: inline-block;
