    font-size: 17px;
    font-weight: bold;
    text-decoration: none;
    box-shadow: 0 0 5px 0 #555555;
}
#feedbackTab a:hover {
    background: #3887B7;
}

/* top info bar */

#infoBar {
    vertical-align: middle;
    z-index: 1000;
    background: inherit;
    display: block;
    text-align: center;
    left: 0;
    right: 0;
    position: fixed;
    line-height: 1.5em;
